import React from 'react'
import { connect } from 'react-redux'

class Main extends React.Component {

    render() {
        let { fileterResult, showImage } = this.props;

        return (
            <div id = "main">
            <p>{JSON.stringify(fileterResult)}</p>
            <img src = {showImage} ></img>
            </div>
        );
    }
}


const mapStateToProps = (state) => {
    let {fileterResult, showImage } = state.dataReducer
    return {fileterResult: fileterResult, showImage: showImage };
}

export default connect(mapStateToProps)(Main)
